import React from "react";

let mouseOver = false

function over(){
  mouseOver = true
  console.log("Over")
}

function out(){
  mouseOver=false
  console.log("Out")
}



function App() {

  const [trial, letsGo] = React.useState(<button onMouseOver={over} onMouseOut={out}>Submit</button>)

  return (
    <div className="container">
      <h1>Hello</h1>
      <input type="text" placeholder="What's your name?" />
      {trial}
    </div>
  );
}


export default App;
